myApp.controller("themPartnerController",function(n,t,i,r,u,f){n.Partner={};n.chooseImage=function(){var t=new CKFinder;t.selectActionFunction=function(t){n.Partner.image=t;n.$apply()};t.SelectFunction="ShowFileInfo";t.popup()};n.currentIdPartner=f.getParameterByName("idPartner");n.currentIdPartner&&t.get("/API/PartnerAPI/"+n.currentIdPartner).success(function(t){n.Partner={id:t.id,title:t.title,image:t.image,link:t.link}});n.savePartner=function(){n.currentIdPartner?t.put("/API/PartnerAPI/"+n.Partner.id,n.Partner).success(function(){toastr.success("Thành công","Lưu đối tác")}).error(function(){toastr.error("Thất bại","Thêm đối tác")}):t.post("/API/PartnerAPI/",n.Partner).success(function(){toastr.success("Thành công","Thêm đối tác");i.location.href="/Admin/Partners"}).error(function(){toastr.error("Thất bại","Thêm đối tác")})};n.savePartnerAndExit=function(){n.currentIdPartner?t.put("/API/PartnerAPI/"+n.Partner.id,n.Partner).success(function(){i.location.href="/Admin/Partners"}).error(function(){toastr.error("Thất bại","Lưu đối tác")}):t.post("/API/PartnerAPI/",n.Partner).success(function(){i.location.href="/Admin/Partners"}).error(function(){toastr.error("Thất bại","Thêm đối tác")})};n.savePartnerAndNew=function(){n.currentIdPartner?t.put("/API/PartnerAPI/"+n.Partner.id,n.Partner).success(function(){i.location.href="/Admin/Partners/Create"}).error(function(){toastr.error("Thất bại","Lưu đối tác")}):t.post("/API/PartnerAPI/",n.Partner).success(function(){i.location.href="/Admin/Partners/Create"}).error(function(){toastr.error("Thất bại","Thêm đối tác")})};n.cancel=function(){i.location.href="/Admin/Partners"};n.changeTitle=function(){n.Partner.alias=Alias.genAlias(n.Partner.title)}});